import React, { Fragment } from 'react';

import { makeStyles } from '@material-ui/core/styles';
import { GridList, GridListTile, GridListTileBar, IconButton, Icon } from '@material-ui/core';

const useStyles = makeStyles(theme => ({
    root: {
        display: 'flex',
        flexWrap: 'wrap',
        justifyContent: 'space-around',
        overflow: 'hidden',
        backgroundColor: theme.palette.background.paper,    
        margin: '0 auto',
    },
    gridList: {
        width: 500,
        height: 450,
        transform: 'translateZ(0)',
    },
    titleBar: {
        background: 
        'linear-gradient(to bottom, rgba(0,0,0,0.7) 0%, ' +
        'rgba(0,0,0,0.3) 70%, rgba(0,0,0,0) 100%)',
    },
    icon: {
        color: 'white',
    },
}))

const gallery = [
    {
        img: 'https://images.unsplash.com/photo-1561312176-5aedf7172115?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=500&q=60',
        title: 'Pupper'
    },
    {
        img: 'https://images.unsplash.com/photo-1561324555-88df4bfae809?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=500&q=60',
        title: 'Day Out on Lake'
    },
    {
        img: 'https://images.unsplash.com/photo-1561344640-2453889cde5b?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=500&q=60',
        title: 'Tokyo Ghost'
    },
    {
        img: 'https://images.unsplash.com/photo-1561356573-f8b6dfb1ec33?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=500&q=60',
        title: 'Cars & Coffee'
    }
]

function Photos() {

    const classes = useStyles();

    return (
        <div className={classes.root}>
            <GridList cellHeight={200} spacing={1} className={classes.gridList}>
                {gallery.map((photo, index) => {
                    return (
                        <GridListTile key={index}>
                            <img src={photo.img} alt={photo.title} />
                            <GridListTileBar 
                                title={photo.title}
                                titlePosition="top"
                                actionIcon={
                                    <IconButton className={classes.icon}>
                                        <Icon>star_border</Icon>
                                    </IconButton>
                                }
                                actionPosition="left"
                                className={classes.titleBar}
                            />
                        </GridListTile>
                    );
                })}
            </GridList>
        </div>
    );
}

export default Photos;
